        -webkit-box-shadow: 0px 0px 80px 17px rgba(214, 185, 0, 0.25);
        -moz-box-shadow: 0px 0px 80px 17px rgba(214, 185, 0, 0.25);
        box-shadow: 0px 0px 80px 17px rgba(214, 185, 0, 0.25);
      }
    }

    .profile-section {
      vertical-align: top;
      display: inline-block;
      max-width: 500px;
      padding: 20% 0 0 0;

      .profile {
        h1 {
          font-size: 2.3rem;
          font-weight: 500;
          line-height: 1.3;
          margin: 0 0 1rem;
          span {
            color: $color1;
          }
        }

        h5 {
          font-size: 1.1rem;
          margin: 0 0 2rem;
        }
        p {
          color: $color5;
          font-weight: 300;
          line-height: 1.4;
          margin: 0 0 2rem;
        }
      }
    }
  }
}

